def predict(triples: list[Triple]) -> str:
    sentence = ""
    if triples:
        sentence += triples[0].subject + " "
        for i, triple in enumerate(triples):
            if triple.predicate == "category":
                sentence += f"is a {triple.object}"
            elif triple.predicate == "country":
                sentence += f" is in {triple.object}"
            elif triple.predicate == "location":
                sentence += f" and is located in {triple.object}"
            elif triple.predicate == "municipality":
                sentence += f" and is in the municipality of {triple.object}"
            elif triple.predicate == "state":
                sentence += f" and is in the state of {triple.object}"
            elif triple.predicate == "dedicatedTo":
                sentence += f" and is dedicated to {triple.object}"
            elif triple.predicate == "designer":
                sentence += f" and was designed by {triple.object}"
            elif triple.predicate == "material":
                sentence += f" and is made of {triple.object}"
            elif triple.predicate == "capital":
                sentence += f" and its capital is {triple.object}"
            else:
                sentence += f" {triple.predicate} {triple.object}"
        sentence = sentence.replace(" and ", ", ")
    return sentence

